pragma solidity >0.5.0 <0.9.0;
contract Room {
    uint256 public currentRound;
    uint256 public totalRound;
    bytes32[2][3] public cardsHash;
    address public creator;
    address public player1;
    address public player2;
    uint256 public launchTime;
    uint256 public roundTimeout;
    uint256 public initialHP;

    event submitCardsHash(address player, bytes32 cardsHash, uint256 round);
    event submitCards(address player, string cards, string salt, uint256 round);
    event startANewRound(uint256 round);

    modifier onlyCreator() {
        require(msg.sender == creator, "invalid creator");
        _;
    }

    modifier onlyPlayer() {
        require(msg.sender == player1 || msg.sender == player2, "invalid player");
        _;
    }

    modifier ensureCardsHashSubmitted() {
        require(cardsHash[currentRound-1][0] != bytes32(0), "player1 hasn't submitted cards");
        require(cardsHash[currentRound-1][1] != bytes32(0), "player2 hasn't submitted cards");
        _;
    }

    constructor(address _player1, address _player2, uint256 _roundTimeout, uint256 _totalRound, address _creator, uint256 _initialHP) {
        player1 = _player1;
        player2 = _player2;
        roundTimeout = _roundTimeout;
        totalRound = _totalRound;
        launchTime = block.timestamp;
        currentRound = 1;
        creator = _creator;
        initialHP = _initialHP;
    }

    function StartANewRound() public onlyCreator {
        currentRound += 1;
        emit startANewRound(currentRound);
    }

    function SubmitCardsHash(bytes32 _cardsHash, uint256 _round) public onlyPlayer {
        require(currentRound == _round && currentRound <= totalRound, "invalid round");
        if (msg.sender == player1) {
            // player1 submit cards
            require(cardsHash[currentRound-1][0] == bytes32(0), "player1 has already submitted cards hash");
            cardsHash[currentRound-1][0] = _cardsHash;
            emit submitCardsHash(msg.sender, _cardsHash, currentRound);
        } else {
            // player2 submit cards
            require(cardsHash[currentRound-1][1] == bytes32(0), "player2 has already submitted cards hash");
            cardsHash[currentRound-1][1] = _cardsHash;
            emit submitCardsHash(msg.sender, _cardsHash, currentRound);
        }
    }

    function SubmitCards(string calldata _cards, string calldata _salt, uint256 _round) public onlyPlayer ensureCardsHashSubmitted {
        require(currentRound == _round && currentRound <= totalRound, "invalid round");

        if (msg.sender == player1) {
            // player1 submit cards
            require(cardsHash[currentRound-1][0] == keccak256(abi.encodePacked(_cards, _salt)), "invalid cards");
            emit submitCards(msg.sender, _cards, _salt, currentRound);
        } else {
            // player2 submit cards
            require(cardsHash[currentRound-1][1] == keccak256(abi.encodePacked(_cards, _salt)), "invalid cards");
            emit submitCards(msg.sender, _cards, _salt, currentRound);
        }
    }
}

