pragma solidity >0.5.0 <0.9.0;

import {Room} from "./Room.sol";

contract RoomManager {

    address[] managers;
    mapping(address => uint256) public managerIndex;
    mapping(address=>address[]) public Rooms;
    address player1;
    address player2;
    address player1_tmp;
    address player2_tmp;
    event RoomCreated(
        address _player1,
        address _player2,
        address _player1_tmp,
        address _player2_tmp,
        uint256 _totalRound,
        address _roomAddress,
        uint256 _initialHP
    );

    modifier onlyManager() {
        require(managers[managerIndex[msg.sender]] != address(0), "invalid manager");
        _;
    }

    constructor() {
        managers.push(msg.sender);
        managerIndex[msg.sender] = managers.length - 1;
    }

    function addManager(address _newManager) public onlyManager{
        require(_newManager != address(0), "invalid manager");
        require(managers[0] != _newManager && managerIndex[_newManager] == 0, "existed manager");
        managers.push(_newManager);
        managerIndex[_newManager] = managers.length - 1;
    }

    function CreateRoom(address _player1, address _player2, address _player1_tmp, address _player2_tmp, uint256 _roundTimeout, uint256 _totalRound, uint256 _initialHP) public onlyManager {
        player1 = _player1;
        player2 = _player2;
        player1_tmp = _player1_tmp;
        player2_tmp = _player2_tmp;
        address room = address (new Room(_player1_tmp, _player2_tmp, _roundTimeout, _totalRound, msg.sender, _initialHP));
        Rooms[msg.sender].push(room);
        emit RoomCreated(_player1, _player2, _player1_tmp, _player2_tmp, _totalRound, room, _initialHP);
    }

    function listRooms(address _creator) public view returns (address[] memory) {
        return Rooms[_creator];
    }
}

